"use strict";window.filters={recommend:function(n){return n.slice(0,10)},popular:function(n){return n.slice().sort(function(n,t){return t.likes-n.likes})},discussed:function(n){return n.slice().sort(function(n,t){return t.comments.length-n.comments.length})},random:function(n){return n.slice().sort(function(){return.5-Math.random()})}};